import React, { useState, useEffect, useRef } from "react";
import Lines from "./Lines";
import Message from "./Message";
import PrintLines from "./PrintLines";
import socketIO from "socket.io-client";
import { DragDropContext, Droppable, Draggable } from '@hello-pangea/dnd';
import { utils, writeFileXLSX } from "xlsx";


const BASE_URL = process.env.REACT_APP_BASE_URL || 'http://localhost:5000'

const socket = socketIO.connect(BASE_URL);

function Machines() {
  const [machines, setMachines] = useState({});
  const [selectedItems, setSelectedItems] = useState({});
  const [currentMessages, setNewMessage] = useState({});

  useEffect(() => {
    const getData = async () => {
      try {
        const data = await fetch(`${BASE_URL}/api`);
        const json = await data.json();
        setMachines(json);
      } catch (error) {
        console.log(error);
      }
    };
    getData();
  }, []);

  useEffect(() => {
    socket.on("machines", (data) => {
      setMachines(data);
    });
  }, []);

  useEffect(() => {
    socket.on("selectedLinesUpdated", (data) => {
        const {machineId, selectedLines} = data;
       setSelectedItems((prevSelectedItems) => ({
        ...prevSelectedItems,
        [machineId]: selectedLines
       }));
    });
  }, [])

  useEffect(() => {
    socket.on("newMessage", (data) => {
        const {machineId, newMessage} = data;
        setNewMessage((previousMessages) => ({
            ...previousMessages,
            [machineId]: newMessage
        }));
        });
    }, [])

  function handleDragEnd({ destination, source }) {
    if (!destination) return;
    if (destination.index === source.index && destination.droppableId === source.droppableId) return;

    // TODO: Handle drag and drop logic here

    socket.emit('taskDragged', {
      source,
      destination,
    });
  };

  const handleMessage = (machineId, group, message) => {
    socket.emit('messageUpdate', {
        machineId,
        group,
        message
    })
  }

  const handleSelect = (machineId, key, level, isChecked, value) => {
    socket.emit('linesSelected', {
        machineId,
        key,
        level,
        isChecked,
        value
      })
  };

  const handleSendJson = (machineId, group) => {
    socket.emit('submitdata', {
      machineId,
      group
    })

    console.log(machineId)
  }

  let listRef = useRef();

  const [open, setOpen] = useState(false);
  useEffect(() => {

    let handler = (e) => {
      if(e.target){
      setOpen(false)
      }
    }; 

    document.addEventListener("mousedown", handler)
  }); 



  return (
    <div className="max-width">
    <div className="drag-n-drop">
      <DragDropContext onDragEnd={handleDragEnd}>
        {Object.entries(machines).map(([key, group]) => (
          <div key={key} className="dnd-group">
            <h3 className='group-title'>{group.title}</h3>
            <Droppable droppableId={group.title}>
              {(provided) => (
                <div className="group-grid" ref={provided.innerRef} {...provided.droppableProps}>
                  {group.items.map((item, index) => (
                    <Draggable key={item.id} draggableId={`${item.id}`} index={index}>
                      {(provided) => (
                        <div
                          ref={provided.innerRef}
                          {...provided.draggableProps}
                          {...provided.dragHandleProps}
                          className="dnd-item"
                          
                        >
                         <div className="flex top"><b>{item.value}</b>
                         <button onClick={() => handleSendJson(item.id, group.title)}>Submit Data</button></div> 
                          <Lines onClick={() => {setOpen(!open)}} ref={listRef} open={open} group={group.title} onSelect={(level, isChecked, value) => handleSelect(item.id, group.title, level, isChecked, value)} />
                          <PrintLines selectedLines={selectedItems[item.id]|| []} />
                          <Message onMessage={(message) => handleMessage(item.id, group.title, message)} value={currentMessages[item.id]}/>
                        </div>
                      )}
                    </Draggable>
                  ))}
                  
                  {provided.placeholder}
                </div>
              )}
            </Droppable>
            
          </div>
        ))}
      </DragDropContext>
    </div>
    </div>
  );
}

export default Machines;
